import React from "react";
import './ContactCard.css';

const ContactCard = () => {
  return (
    <div className="contact-card mt-5">
      <div className="card-content">
        <h5>
          Website by <a href="https://darshanraval.netlify.app" target="_blank" rel="noopener noreferrer" className="name">Darshan Raval</a>
        </h5>
        <p className="contact-info">
          Reach out at: <a href="mailto:darshanraval3546@gmail.com" className="contact-email">darshanraval3546@gmail.com</a>
        </p>
        <div className="social-icons">
          <a href="https://www.linkedin.com/in/darshanraval" target="_blank" rel="noopener noreferrer" className="icon linkedin">
            <i className="fab fa-linkedin"></i>
          </a>
          <a href="https://github.com/darshanraval" target="_blank" rel="noopener noreferrer" className="icon github">
            <i className="fab fa-github"></i>
          </a>
          <a href="https://twitter.com/darshanraval" target="_blank" rel="noopener noreferrer" className="icon twitter">
            <i className="fab fa-twitter"></i>
          </a>
        </div>
      </div>
    </div>
  );
};

export default ContactCard;
